import React from "react";
import { Route, Routes } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
import Home from "./Home";
import Service from "./Service";

const App = () => {
  return (
    <>
      <Home />
      <About />
      <Contact />
      <Service />
    </>
  );
};

export default App;
